func testAlbumToOneArtistUsingArtist(t *testing.T) {
	ctx := context.Background()
	tx := MustTx(boil.BeginTx(ctx, nil))
	defer func() { _ = tx.Rollback() }()

	var local Album
	var foreign Artist

	seed := randomize.NewSeed()
	if err := randomize.Struct(seed, &local, albumDBTypes, true, albumColumnsWithDefault...); err != nil {
		t.Errorf("Unable to randomize Album struct: %s", err)
	}
	if err := randomize.Struct(seed, &foreign, artistDBTypes, false, artistColumnsWithDefault...); err != nil {
		t.Errorf("Unable to randomize Artist struct: %s", err)
	}

	if err := foreign.Insert(ctx, tx, boil.Infer()); err != nil {
		t.Fatal(err)
	}

	queries.Assign(&local.ArtistID, foreign.ID)
	if err := local.Insert(ctx, tx, boil.Infer()); err != nil {
		t.Fatal(err)
	}

	check, err := local.Artist().One(ctx, tx)
	if err != nil {
		t.Fatal(err)
	}

	if !queries.Equal(check.ID, foreign.ID) {
		t.Errorf("want: %v, got %v", foreign.ID, check.ID)
	}

	slice := AlbumSlice{&local}
	if err = local.L.LoadArtist(ctx, tx, false, (*[]*Album)(&slice), nil); err != nil {
		t.Fatal(err)
	}
	if local.R.Artist == nil {
		t.Error("struct should have been eager loaded")
	}

	local.R.Artist = nil
	if err = local.L.LoadArtist(ctx, tx, true, &local, nil); err != nil {
		t.Fatal(err)
	}
	if local.R.Artist == nil {
		t.Error("struct should have been eager loaded")
	}
}

